NODES = [n for n in range(11, 100) if n % 10 != 0]
NODE_POS = {n: (n//10, n%10) for n in NODES}
def load_graph():
    assert inp.startswith('U! B= ')
    lines = inp[len('U! B= '):].split(' U! B= ')
    G = nx.Graph()
    # adj = {n: [] for n in NODES}
    for line in lines:
        n1, n2 = line.strip().split()
        assert n1[0] == 'v' and n2[0] == 'v'
        n1 = int(n1[1:])
        n2 = int(n2[1:])
        G.add_edge(n1, n2)
        # adj[n1].append(n2)
        # adj[n2].append(n1)
    # print(list(map(len, adj.values())))
    # return adj
    nx.draw_networkx(G, pos=NODE_POS)
    plt.show()
    return G

def solve():
    values = [
        1, 2, 3, 4, 5, 6, 7, 8, 9,
        4, 5, 6, 7, 8, 9, 1, 2, 3,
        7, 8, 9, 1, 2, 3, 4, 5, 6,
        2, 1, 4, 3, 6, 5, 8, 9, 7,
        3, 6, 5, 8, 9, 7, 2, 1, 4,
        8, 9, 7, 2, 1, 4, 3, 6, 5,
        5, 3, 1, 6, 4, 2, 9, 7, 8,
        6, 4, 2, 9, 7, 8, 5, 3, 1,
        9, 7, 8, 5, 3, 1, 6, 4, 2,
    ]
    out = 0
    for n,v in zip(NODES, values):
        out *= 9
        out += v-1
    print(out)
    
if __name__ == '__main__':
    # load_graph()
    solve()
